import React from "react";
import Link from "next/link";

export const Header = ({}) => {
  console.log("working");

  return (
    <div>
      <nav>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
      </nav>
    </div>
  );
};

export default Header;
